    "import numpy as np\n",
    "import matplotlib.pyplot as plt \n",
    "import scipy as sy \n",
    "import pandas as pd\n",
    "from scipy.interpolate import interp1d\n",
    "from scipy.stats import linregress\n",
    "from sympy import diff\n",
    "\n",
    "#Import the data \n",
    "df = pd.read_csv('Housing_Data.csv')\n",
    "\n",
    "#Convert Philedelphia \n",
    "Phil = df.iloc[7, 89:125:6].to_numpy() \n",
    "date = np.arange(0, len(Phil), 1)\n",
    "\n",
    "#Convert Dubois \n",
    "Dub = df.iloc[437, 89:125:6].to_numpy()\n",
    "\n",
    "#Convert Boston \n",
    "Bos = df.iloc[10, 89:125:6].to_numpy()\n",
    "\n",
    "#Finding vandermonde\n",
    "m = 5\n",
    "A = np.vander(date, increasing=True)\n",
    "A = A[:, :(m+1)]\n",
    "\n",
    "#Solve for coefficients\n",
    "c_1 = np.linalg.inv(A)@(Phil)\n",
    "c_2 = np.linalg.inv(A)@(Dub)\n",
    "c_3 = np.linalg.inv(A)@(Bos)\n",
    "\n",
    "#Plotting functions\n",
    "x_plot = np.linspace(np.min(date), np.max(date), int(1e4))\n",
    "p1_plot = np.polyval(np.flip(c_1), x_plot)\n",
    "p2_plot = np.polyval(np.flip(c_2), x_plot)\n",
    "p3_plot = np.polyval(np.flip(c_3), x_plot)\n",
    "\n",
    "#plot the data and optimized fit for Boston\n",
    "plt.figure(1) \n",
    "plt.plot(x_plot, (p3_plot), 'k-', linewidth=6, label=\"Interpolant\")\n",
    "plt.plot(date, Bos, 'ro', linewidth=5, label = \"Boston, MA\")\n",
    "\n",
    "#Customize Plot: \n",
    "plt.title('Average Home Value', fontsize=20) \n",
    "plt.xlabel('Date (Every 6 months) from January 2007', fontsize=15) \n",
    "plt.ylabel('Home Value', fontsize=15) \n",
    "plt.gca().tick_params(labelsize=10) \n",
    "plt.legend() \n",
    "plt.grid(True, which='both') \n",
    "plt.minorticks_on()\n",
    "\n",
    "#Plot data and interpolant for Philadelphia\n",
    "plt.figure(2)\n",
    "plt.plot(x_plot, (p1_plot), 'k-', linewidth=6, label=\"Interpolant\")\n",
    "plt.plot(date, Phil, 'go', linewidth=1, label = \"Philedelphia, PA\") \n",
    "\n",
    "#Customize Plot: \n",
    "plt.title('Average Home Value', fontsize=20) \n",
    "plt.xlabel('Date (Every 6 months) from January 2007', fontsize=15) \n",
    "plt.ylabel('Home Value', fontsize=15) \n",
    "plt.gca().tick_params(labelsize=10) \n",
    "plt.legend() \n",
    "plt.grid(True, which='both') \n",
    "plt.minorticks_on()\n",
    "\n",
    "#Plot data a interpolant for Dubois\n",
    "plt.figure(3)\n",
    "plt.plot(x_plot, (p2_plot), 'k-', linewidth=6, label=\"Interpolant\")\n",
    "plt.plot(date, Dub, 'bo', linewidth=5, label = \"Dubois, PA\") \n",
    "\n",
    "#Customize Plot: \n",
    "plt.title('Average Home Value', fontsize=20) \n",
    "plt.xlabel('Date (Every 6 months) from January 2007', fontsize=15) \n",
    "plt.ylabel('Home Value', fontsize=15) \n",
    "plt.gca().tick_params(labelsize=10) \n",
    "plt.legend() \n",
    "plt.grid(True, which='both') \n",
    "plt.minorticks_on()\n",
    "\n"
